import React from "react";
import "./User_details.css";
import User from "./User";
import Header from "../Workplace/Header";

function User_details() {
    return (
        <div>
            <Header />
            <User />
            <div className="collaborators">
                <h2>Manage people</h2>
            </div>
        </div>
    );
}

export default User_details;
